import React from "react";
import Estilo from "../Hojas de Estilos/Inicio.css"
import Imagen from "../Imagenes/imagen-inicio.jpg"
function Inicio(){
    return(
        <article className="contenedor-inicio">
            <h1 className="eslogan-texto"><i>Juntos hacia un futuro inclusivo y brillante.</i></h1>
            <img src={Imagen} className="eslogan-imagen"/>
        </article>
    );
}

export default Inicio;
